import logo from './logo.svg';
import './App.css';
import React, {useState, useEffect} from 'react';
function App() {
  const [message, setMessage] = useState([]);
  useEffect(()=>{
    fetch("/api/demo-web")
    .then((response)=>{
      console.log(response)
      return response.json();
    })
    .then((data)=>{
      setMessage(data);
    })
  },[]);
  return (
    <div className="App">
      {message}
    </div>
  );
}

export default App;
